import Tabs from './shared/components/Tab/Tab';
import Test from './dishes/pages/Test';

import MainHead from './MainHead';
import {
  BrowserRouter as Router,
  Route,
  Redirect,
  Switch
} from 'react-router-dom';

function App() {
  let routes = (
    <Switch>
      <Route path="/" exact>
        <Test />
      </Route>
      <Route path="/dishes/:menu_category_id" exact>
        <Test />
      </Route>

      <Redirect to="/" />
    </Switch>
  );

  return (
     <Router>

    <MainHead></MainHead>
    {/* <Tabs></Tabs> */}
    {/* <main>{routes}</main>          */}
     </Router>
  );
}
export default App;
